import React from "react";

function MainKonten(){
    return (
        <main role="main">
            <div class="flex w-[990px]">
                <section class="w-3/5 border border-y-0 border-gray-800 max-w-[600px]">
                    <aside>
                        <div class="flex">
                        <div class="flex-1 mx-2">
                            <h2 class="px-4 py-2 text-xl font-semibold text-white">Home</h2>
                        </div>
                        </div>
                    </aside>
                </section>
            </div>
        </main>
    )
  };

export default MainKonten;
